--
-- Triggers `notebooks`
--
DELIMITER $$
CREATE TRIGGER `max_notebooks_per_user` BEFORE INSERT ON `notebooks` FOR EACH ROW BEGIN
    DECLARE notebook_count INT;
    DECLARE max_notebooks INT;

    -- Get the current number of notebooks for the user
    SELECT COUNT(*) INTO notebook_count FROM notebooks WHERE user_id = NEW.user_id;

    -- Determine the maximum number of notebooks allowed based on the user's subscription level
    SELECT CASE
        WHEN subscription_level = 0 THEN 3 -- Free users can have up to 3 notebooks
        ELSE 10 -- Example: Paid users can have up to 10 notebooks
    END INTO max_notebooks
    FROM users
    WHERE id = NEW.user_id;

    -- If the user has reached the maximum number of notebooks, raise an error
    IF notebook_count >= max_notebooks THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Maximum number of notebooks reached for this user';
    END IF;
END
$$
DELIMITER ;

